templates.template_content:
{{- $layer3Interfaces := .ModelStore.Multi "layer3_interfaces" "preloads=node" -}}
{{- $subnets := .ModelStore.Multi "subnets" "sort=+name" -}}
{{- $networkUtil := .Network -}}
{{- $collectionUtil := .Collection -}}

{{- $subnetMap := $collectionUtil.Hash $subnets.Records "ID" -}}
{{- $subnetNodeInterfacesMap := $collectionUtil.Map -}}

nwdiag {
{{- range $i, $subnet := $subnets.Records }}
  network {{ $subnet.Name }} {
    address = "{{ $subnet.Address }}/{{ $subnet.Prefix }}"
  {{- $subnetCIDRString := printf "%s/%d" $subnet.Address $subnet.Prefix }}
  {{- $subnetCIDR := $networkUtil.ParseCIDR $subnetCIDRString }}

  {{- range $j, $layer3Interface := $layer3Interfaces.Records }}
    {{- if eq $subnet.VlanID $layer3Interface.VlanID }}
      {{- $layer3InterfaceCIDRString := printf "%s/%d" $layer3Interface.Ipv4Address $layer3Interface.Ipv4Prefix }}
      {{- $layer3InterfaceCIDR := $networkUtil.ParseCIDR $layer3InterfaceCIDRString }}

      {{- $isIncluding := $subnetCIDR.IsIncluding $layer3InterfaceCIDR }}
      {{- if eq $isIncluding true }}
    {{ $layer3Interface.Node.Name }} [address = "{{ $layer3Interface.Name }} ({{ $layer3Interface.Ipv4Address }})"]
      {{- end }}
    {{- end }}
  {{- end }}
  }
{{- end }}
}
